import './App.css';
import Header from './components/Header';
import List from './components/List';
// import Table from './Table';

function App() {

  const List = ['shabir','abul','musthafa','siddiq']

  return (
    <>
      <h2>Bismillah</h2>
      {/* <Table/> */}
      <Header title='Fullstack'  id='2' />

      <List name ={List} />
      <List />
    </>
  );
}

export default App;
